// App.jsx

import React from 'react';
import { Button, Typography } from '@mui/material';

function App() {
  return (
  <div className="ff">
    <h1 className="ii">Bienvenue sur mon application React avec Tailwind CSS</h1>
    <p className="pp">C'est un exemple de configuration avec Tailwind CSS.</p>

    <Typography variant="h1" color="primary">Bienvenue sur mon application React avec Material-UI</Typography>
    <Button variant="contained" color="primary">Cliquez ici</Button>
  </div>
  );
}

export default App;
